// import package and file
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./user/js/pages/index";
import Contractus from "./user/js/pages/contractus";
import Createpost from "./user/js/pages/createpost";
import Login from "./user/js/pages/login";
import Post from "./user/js/pages/post";
import Forgetpass from "./user/js/pages/forgetpass";
import Signup from "./user/js/pages/signup";
import Prevent from "./user/js/pages/prevent";
import Help from "./user/js/pages/help";
import Rank from "./user/js/pages/ranking";
import Axios from "axios"

// ที่รวม Routh ต่างๆ
const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <Home />
        </Route>
        <Route path="/post/create" exact>
          <Createpost />
        </Route>
        <Route path="/post" exact>
          <Post />
        </Route>
        <Route path="/ranking" exact>
          <Rank />
        </Route>
        <Route path="/login" exact>
          <Login />
        </Route>
        <Route path="/signup" exact>
          <Signup />
        </Route>
        <Route path="/forgetpass" exact>
          <Forgetpass />
        </Route>
        <Route path="/prevent" exact>
          <Prevent />
        </Route>
        <Route path="/help" exact>
          <Help />
        </Route>
        <Route path="/contractus" exact>
          <Contractus />
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
